import React, { Component } from "react";
import { NavbarConsumer, NavbarProvider } from "./NavbarContext";
import Link from "./Link";

//Navbar
const navlink = {link_1:"index.html",link_2:"activity.html",link_3:"product.html"};

class Navbar extends Component{

    render(){
        return (
            <NavbarConsumer>
                {(navContent) => {
                    return (
                        <ul>
                            {Object.keys(navContent).map(
                                key => 
                                <li key={key}>
                                    <NavbarProvider value={navlink}>
                                        <Link>{navContent[key]}</Link>
                                    </NavbarProvider>
                                </li>)}
                        </ul>
                    );
                }}
            </NavbarConsumer>
        );
    }

}

export default Navbar;
